// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Melody.sol";
import "./CommonModifier.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract SongElection is Ownable, CommonModifier {
    using SafeMath for uint256;

	struct Song {
		address owner;
		uint256 votes;
	}

	mapping(string => Song) public participants;
	Melody token;
	uint256 song_registration_fee;
	uint256 half_star_value;

	modifier canRegisterSong() {
		require(token.balanceOf(msg.sender) >= song_registration_fee, "Not enough funds to register a song");
		_;
	}

	modifier canVote(uint256 half_stars) {
		require(token.balanceOf(msg.sender) >= half_stars * half_star_value, "Not enough funds to give this vote");
		_;
	}

	constructor(uint256 _start, uint256 _end, Melody _token, uint256 _song_registration_fee, uint256 _half_star_value) {
		token = _token;
		song_registration_fee = _song_registration_fee * 1 ether;
		half_star_value = _half_star_value * 1 ether;
		start = _start;
		end = _end;
	}

	function registerSong(string memory song_hash) public canRegisterSong payable {

	}

	function vote(string memory song_hash, uint256 half_stars) public canVote(half_stars) payable {

	} 
}
